import {client} from '../../../client'
import * as actions from './index'
export const  getSearchViolation=()=>{
    return async(dispatch)=>{
        dispatch(actions.getSearchViolationRequest())
        let data
        try{
            data=await client.getSearchViolation()
        }catch(error){
            dispatch(actions.getSearchViolationFailute())
            return error
        }
        return dispatch(actions.getSearchViolationSuccess(data))
    }
}
